import React from 'react';
import CardItem from './CardItem';
import './Cards.css';

function Cards() {
    return (
        <div className='cards'>
            <h1>All features</h1>
            <div className="cards__container">
                <div className="cards__wrapper">
                    <ul className="cards__items">
                        <CardItem src='.../img/facial_expression.png' text='Facial Expression' label='FE' path='/animator'/>
                        <CardItem src=".../img/head_movement.png" text="Head Movement" label='HM' path='/animator'/>
                        <CardItem src=".../img/eye_movement.png" text="Eye Movement" label='EM' path='/animator'/>
                        <CardItem src=".../img/gender_customization.png" text="Gender Customization" label='GC' path='/animator'/>
                        <CardItem src=".../img/face_aging.png" text="Face Aging" label='FA' path='/animator'/>
                        <CardItem src=".../img/anime_style.png" text="Anime Style Image" label='AS' path='/animator'/>
                        <CardItem src=".../img/producing_audio.png" text="Produce Audio" label='PS' path='/animator'/>
                    </ul>
                </div>
            </div>
        </div>
    );
}

export default Cards;
